const GroceryForm = () => (
  <Stack spacing="2rem">
    <Heading as="h1" size="2xl">
      Add Items
    </Heading>
    <Flex>
      <form>
        <Input />
        <Input />
        <IconButton />
      </form>
    </Flex>
  </Stack>
);

export default GroceryForm;
